Read and return the counter property value from the contract storage. fn count() -> u64 { return storage.counter;
} The function body accesses the value counter in storage, and increments the value by one. Then, we return the newly updated value of counter. fn increment() { storage.counter = storage.counter + 1;
} Here's what your code should look like so far: contract; storage { counter: u64 = 0,
} abi Counter { #[storage(read, write)] fn increment(); #[storage(read)] fn count() -> u64;
} impl Counter for Contract { #[storage(read)] fn count() -> u64 { return storage.counter; } #[storage(read, write)] fn increment(){ storage.counter = storage.counter + 1; }
}

